import React, { Component } from 'react'
import WrapComponents from '@/components/wrapper'
import { Radio } from 'node_modules/semantic-ui-react/index'

class Segementation extends Component {
    state = {
        createSegment: false,
    }
    render() {
        return (
            <WrapComponents>
                <div className="section">
                    <Radio
                        checked={!createSegment}
                        onChange={() => this.setState({ createSegment: !createSegment })}
                    >
                        All Users
                    </Radio>
                    <Radio
                        checked={!createSegment}
                        onChange={() => this.setState({ createSegment: !createSegment })}
                    >
                        Create Segement
                    </Radio>
                </div>
            </WrapComponents>
        )
    }
}

export default Segementation
